import DefaultLayout from "../../Layouts/DefaultLayout";
import { Row, Col } from "../../components/Grid";
import PageTitle from "../../components/PageTitle";
import styled from "styled-components";
import Container from "../../components/Container";

const SpaceBetween = styled(Row)`
  justify-content: space-between;
`;

const SkillsWrap = styled.ul`
  display: flex;
  justify-content: flex-start;
  flex-wrap: wrap;
`;

const Skill = styled.li`
  padding: 6px;
  line-height: 16px;
  font-size: 16px;
  background-color: #0800c9;
  color: white;
  margin: 4px;
`;

const TechPage = () => {
  return (
    <DefaultLayout>
      <Container>
        <PageTitle title="tech stack" />
        <SpaceBetween style={{ marginTop: `72px` }}>
          <Col width={[1, 1, 5 / 12]}>
            <h2>Code</h2>
            <p>
              I have produced and worked on production sites using with php and
              JS frame works.
            </p>
            <h3>Preferred JS Stack</h3>
            <SkillsWrap>
              <Skill>Next.js</Skill>
              <Skill>Vercel</Skill>
              <Skill>GraphQL</Skill>
              <Skill>Reddis</Skill>
              <Skill>StoryBook</Skill>
              <Skill>Github</Skill>
            </SkillsWrap>
            <h3>Preferred PHP Stack</h3>
            <ul>
              <Skill>WordPress</Skill>
              <Skill>mySQL</Skill>
              <Skill>deployHQ</Skill>
              <Skill>bitBucket</Skill>
            </ul>
          </Col>
          <Col width={[1, 1, 5 / 12]}>
            <h2>Design</h2>
            <p>
              I have a comprehensive understanding in all major design tools, my
              current preferred tools are Figma and InVison Studio for
              prototyping and producing design systems.
            </p>
          </Col>
        </SpaceBetween>
      </Container>
    </DefaultLayout>
  );
};

export default TechPage;
